import React,{useState, useEffect} from 'react';
import './Receipt.css'
import img from './samples/receipt.png'
import axios from 'axios'
import {useParams} from 'react-router-dom'


const Receipt=() => {

  let {id}  = useParams();
  console.log(id)
  // JSON.stringify(id, null).replace(/['"]+/g, '')
   const [p,setp]= useState({});

useEffect(()=>{

  let url = '/api/'+ id
  console.log(url)
  axios.get(url).then(function(res){
     console.log(res.data);
     if(res.data!=null){
      
       setp(res.data[0]);
     }
     else
     {
         return(<>
           NO CAR EXISTS
         </>)
      
     }

     
 })
    

},[])


  return(
  <>
  <div className="body">
    <div className="receipt-title">
      Parking Receipt
    </div>
    <div className="receipt-pic">

        <img src={img} alt="CAR"></img>
    </div>
    <div className="receipt-car">
        <div className="receipt-car-title">
            <div><h4> Parking Details</h4></div>

            <div>{p.id}</div>
        </div>
    
        <div className="receipt-car-name">
            <div> {p.color}, {p.model}<br/> {p.plateNumber}</div>

            <div>Slot No. :- {p.slot}</div>
        </div>

    </div>
    <div className="receipt-right">
        
        <div> Parking History ></div>

      </div>
  </div>
  </>)

}

export default Receipt;
